import './App.css';
const Region = () =>{
  
    const [equipo, setEquipo] = React.useState([])

    React.useEffect(() =>{
//console.log('useEffect')
obtenerDatos()
    }, [])
    const obtenerDatos = async () =>{
        const data = await fetch('http://127.0.0.1:8000/api/welcome')
        const users = await data.json()
        setEquipo(users)
    }
return (
    <div>
        <h1 class="text-center text-primary">Region</h1>
        <table class="table  table-bordered stacktable table-sm">
    <thead>
      <tr class="table-primary" >
      <th scope="col">Region</th>
        <th scope="col">Nombre Cliente</th>
    
      </tr>
    </thead>
    <tbody>
{
    equipo.map(item => (
      <tr>
      <th scope="row" key={item.id}>{item.id}</th>
      <td>{item.nombre}</td>

        

      </tr>
     
  
    ))
}
</tbody>
  </table>
        
    </div>
)

}


export default Region;
